import urlJoin from "url-join";
import { httpPostSimple } from "./makeRequest.js";
/**
 * Get data for all the frogs. Optionally upload new frogs.
 *
 * This endpoint is only available to authenticated admin users.
 */
export async function requestFrogCryptoUpdateFrogs(zupassServerUrl, req) {
    return httpPostSimple(urlJoin(zupassServerUrl, "/frogcrypto/admin/frogs"), async (resText) => ({
        value: JSON.parse(resText),
        success: true
    }), req);
}
